import { ArrowLeftOutlined, ArrowRightOutlined } from "@mui/icons-material"
import styled from "styled-components"

const Container = styled.div`
margin-top: 33px;
width:100%;
height:100vh;
display: flex;
background-color: coral;
position:relative;
`;
const Arrow = styled.div`
width: 50px;
height: 50px;
background-color: #fff7f7;
border-radius: 50%;
display: flex;
align-items: center;
justify-content: center;
position:absolute;
top: 0;
bottom: 0;
margin
`;
const Slider = () => {
    return (
        <Container>
            <Arrow>
                <ArrowLeftOutlined />
            </Arrow>
            <Arrow>
                <ArrowRightOutlined />
            </Arrow>
        </Container>
    )
}

export default Slider
